	function click(d) {
		if(d.depth==3){
			
				$('#tablecontainer').fadeIn();
				var table=$('#tablecontainer')[0];
				var htm = '';
				htm+='<div style="width:100%;position:fixed;left:0px;bottom:0px;border-radius: 25px;border: 2px solid white;" class="alert alert-info">';
				htm+=	'<a href="#" class="close" data-dismiss="alert" aria-label="close">&times;</a>';
				
				
	//			<ol class="breadcrumb" style="margin-bottom: 5px;">
  //<li><a href="#">Home</a></li>
  //<li><a href="#">Library</a></li>
  //<li class="active">Data</li>
//</ol>
				var breadcrumbs = [];
				var addcrumbs = function(n){
					breadcrumbs.push(n.name);
					if(n.parent){
						addcrumbs(n.parent);
					}
				}
				addcrumbs(d);
				console.log('bcrg');
				console.log(breadcrumbs);
				var crumbHtml = '<ol class="breadcrumb" style="margin-bottom: 5px;">';
				for(var i= breadcrumbs.length-1;i>=0;i--){
					var style='';
					if(i==0){
						style=' style="font-size:18px;font-weight:bold;" ';
					}
					crumbHtml+='<li '+style+'class="active">'+breadcrumbs[i]+'</li>';
				}
				
				crumbHtml+='</ol>';
				
				//htm+='<div style="height:22px;width:100%;font-height:16px;"><span class="glyphicon glyphicon-info-sign">'+d.name+'</span></div>';
				htm+=crumbHtml;
				htm+=	'<div id="table">';
				for(var i = 0 ; i <d.leafAttributes.length ; i++){
					htm+=		'<div class="row">'
					//console.log(i);
					//console.log(d.leafAttributes[i]);
					var tip = '<a href="https://www.nichd.nih.gov/research/NCS/Pages/researchers.aspx">'+
					          '<button style="margin:0px;padding:0px;padding-right:20px;" type="button" class="btn btn-default" aria-label="Left Align">'+
							  '<span class="glyphicon glyphicon-eye-open pull-left" aria-hidden="true"></span>&nbsp;<span style="font-size:11px;" class="badge">'+(Math.floor(Math.random()*1000))+' available</span>'+
							  '</button>'+
							  '</a>';
					if(d.leafAttributes[i].chrometooltip==null){
						tip='No Data';
					}
					htm+='<div class="col-md-6">'+d.leafAttributes[i].chrome+'</div>';
					htm+='<div class="col-md-5">'+d.leafAttributes[i].chrometooltip+'</div>';
					htm+='<div style="align:left;" class="col-md-1"><span class="pull-right">'+tip+'</span></div>';
					htm+=		'</div>';
				}					
				htm+=	'</div>';
				htm+='</div>';
				table.innerHTML=htm;
			
		}else{
			$('#tablecontainer').fadeOut();
			$('#tablecontainer')[0].innerHTML='';
				
			
		}
					
					
		if(d.depth<3){
			if (d.children) {
				d._children = d.children;
				d.children = null;
				console.log(1);

			} else {
				d.children = d._children;
				d._children = null;
				console.log(2);

				
			}
			update(d);	
		}	    
	}
